import React from "react";
import Table from 'react-bootstrap/Table';
import AirData from './AirData';

const factors = () => {
    const keys = Object.keys(AirData);
    console.log("WHAT",keys);
    return (
        <div>
            <Table bordered id = "rowz" data = {AirData}>
                <thead>
                    <tr>
                        <th>Flight Name</th>
                        <th>Departure Location</th>
                        <th>Wind Speed</th>
                        <th>Holidays</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{AirData[0].name}</td>
                        <td>{AirData[0].dest}</td>
                        <td>{AirData[0].speed}</td>
                        <td>{AirData[0].holidays}</td>
                    </tr>
                    {
                        AirData.map(data_key => (
                        <tr>
                          <td>{data_key[keys].name}</td>
                        </tr>
                    ))
                    }
                </tbody>
            </Table>
        </div>
    );
}
export default factors;
